import React, { useEffect, useState } from 'react'
import Player from '../../models/Player';
import Dado from '../../components/Dado';
import DadoModel from '../../models/Dado';

function Home(props) {

    const [ dado, setDado ] = useState(new DadoModel());

    useEffect(() => {
        jogar();
    }, [] )

    function jogar() {
        let d = new DadoModel();
        d.jogarDado();
        setDado(d);
    }

    return (<>
        <div className="col-xl-12 mt-3">
            <button
                onClick={dado.jogarDado}
                className="btn btn-success mb-3"
            >
                Jogar
            </button>
            {!!dado.getNumero() && (
                <Dado dado={dado.getNumero()} />
            )}
        </div>
    </>)
}

export default Home;
